/* Задача 1
 Пусть в таблице users поля created_at и updated_at оказались незаполненными. Заполните их текущими датой и временем.
 */

-- Создание пустых полей
ALTER TABLE users ADD COLUMN created_at DATETIME NULL DEFAULT NULL;
ALTER TABLE users ADD COLUMN updated_at DATETIME NULL DEFAULT NULL;

-- Заполнение полей текущей датой и временем
UPDATE users
set
	created_at = now(),
	updated_at = now();
	
/* Задача 2
Таблица users была неудачно спроектирована. Записи created_at и updated_at были заданы типом VARCHAR и в них долгое время помещались значения в формате 20.10.2017 8:10. 
Необходимо преобразовать поля к типу DATETIME, сохранив введённые ранее значения.
 */
-- Удаляем предыдущие поля
ALTER TABLE users 
  DROP COLUMN created_at,
  DROP COLUMN updated_at;

-- Создаём поля, задаём тип VARCHAR
ALTER TABLE users 
ADD created_at VARCHAR(100) NULL;
ALTER TABLE users 
ADD updated_at VARCHAR(100) NULL;

update users 
set 
	created_at = '20.10.2017 8:10',
	updated_at = '20.10.2017 8:10';
	
-- Преобразовываем поле к типу Datetime
update users 
set
	created_at = STR_TO_DATE('20.10.2017 8:10', '%d.%m.%Y %H:%i'),
	updated_at = STR_TO_DATE('20.10.2017 8:10', '%d.%m.%Y %H:%i');

/* Задача 3
В таблице складских запасов storehouses_products в поле value могут встречаться самые разные цифры: 0, если товар закончился и выше нуля, если на складе имеются запасы. 
Необходимо отсортировать записи таким образом, чтобы они выводились в порядке увеличения значения value. 
Однако нулевые запасы должны выводиться в конце, после всех записей.
 */
-- создаём таблицу `storehouses_products` и поле `value`
DROP TABLE IF EXISTS `storehouses_products`;
create table storehouses_products (
	id SERIAL PRIMARY KEY,
    `value` INT null
);
-- заполняем поле значениями
INSERT INTO
    storehouses_products (value)
VALUES
    (0),
    (2500),
    (0),
    (30),
    (500),
    (1);
-- выводим отсортированные числа 
SELECT 
    value
FROM
    storehouses_products ORDER BY IF(value > 0, 0, 1), value;
    
   /* Практическое задание 1
Подсчитайте средний возраст пользователей в таблице users.
 */
	
SELECT AVG(age)
FROM users;

   /* Практическое задание 2
Подсчитайте количество дней рождения, которые приходятся на каждый из дней недели. 
Следует учесть, что необходимы дни недели текущего года, а не года рождения.
 */

SELECT
	DATE_FORMAT(DATE(CONCAT_WS('-', YEAR(NOW()), MONTH(birthday), DAY(birthday))), '%W') AS day,
	COUNT(*) AS quantity
FROM
	profiles
GROUP BY
	day;
	
   /* Практическое задание 3
(по желанию) Подсчитайте произведение чисел в столбце таблицы.
 */

DROP TABLE IF EXISTS `composition`;
create table composition (
	id SERIAL PRIMARY KEY,
    `value` INT null
);
-- заполняем поле значениями
INSERT INTO
    composition (value)
VALUES
    (1),
    (2),
    (3),
    (4),
    (5);
SELECT ROUND(exp(SUM(ln(value))), 0) AS num FROM composition;